import React from 'react';

class ModalVertically extends React.Component {
    constructor() {
        super();

        this.state = {
            name: ''
        }

        this.onSubmit = this.onSubmit.bind(this);
        this.onChange = this.onChange.bind(this);
    }

    onSubmit() {
        // this.props.setClickedModal();
        // this.props.setNameForMarker("Oslo");
    }

    onChange(e) {
        this.setState({ [e.target.name]: e.target.value });
    }

    render() {
        return (
            <div className="modal fade" id="modalCenter" tabindex="-1" role="dialog" aria-labelledby="modalCenterTitle" aria-hidden="true">
                <div className="modal-dialog modal-dialog-centered" role="document">
                    <div className="modal-content">
                    <div className="modal-header">
                        <h5 className="modal-title" id="modalCenterTitle">Add marker to story</h5>
                        <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                            <span aria-hidden="true">&times;</span>
                        </button>
                    </div>
                    <div className="modal-body">
                        <div className="form-group">
                            <label for="message-text" className="col-form-label">Name for marker:</label>
                            <input className="form-control" id="message-text" data-input={this.state.name} value={this.state.name} onChange={this.onChange} />
                        </div>
                    </div>
                    <div className="modal-footer">
                        <button type="button" className="btn btn-danger" data-dismiss="modal">Close</button>
                        <button 
                            type="button" 
                            className="btn btn-primary"
                            onClick={this.onSubmit}
                        >
                            Save changes
                        </button>
                    </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default ModalVertically;
